const propertyName = "access_token"
export const auth = {
  login: (token)=>{
    localStorage.setItem(propertyName,token);
  },
  logout: ()=>{
    localStorage.removeItem(propertyName);
  },
  isAuthenticated: () =>{
    return localStorage.getItem(propertyName);
  }
}
